import React from "react";
import { Grid, CardMedia, IconButton, withStyles } from "@material-ui/core";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faChevronLeft,
  faChevronRight
} from "@fortawesome/free-solid-svg-icons";

const styles = theme => ({
  container: {
    flexGrow: 1,
    margin: theme.spacing(0),
    flex: 1,
    background: "blue"
  },
  landingPage: {
    background: "red"
  }
});

const Home = withStyles(styles)(({ classes }) => (
  <div className={classes.container}>
    <CardMedia image="" className={classes.landingPage}>
      <Grid
        container
        direction="row"
        style={{
          alignContent: "center",
          alignItems: "center",
          justifyContent: "space-between",
          flexGrow: 1,
          flex: ""
        }}
      >
        <IconButton>
          <FontAwesomeIcon style={{ color: "white" }} icon={faChevronLeft} />
        </IconButton>
        <IconButton>
          <FontAwesomeIcon style={{ color: "white" }} icon={faChevronRight} />
        </IconButton>
      </Grid>
    </CardMedia>
  </div>
));

export default Home;
